import React from "react";

function Advice() {
  return (
    <div>
      <h1>Conseils</h1>
      <p>
        Conseil 1: Prenez des pauses régulières pour améliorer votre
        concentration.
      </p>
      <p>
        Conseil 2: Établissez des priorités et concentrez-vous sur les tâches les
        plus importantes en premier.
      </p>
      <p>
        Conseil 3: Fixez-vous des objectifs réalistes et divisez les gros projets
        en petites tâches gérables.
      </p>
    </div>
  );
}

export default Advice;
